import { createBrowserRouter } from "react-router-dom";
import App from './components/App'
import Home from "./components/Home";
import Login from "./components/Login";

const routes = createBrowserRouter([
    {
        path: "/",
        element: <App />,
        children: [
            {
                path: "/",
                element: <Login/>
            },
            
        ]
    }
])

export default routes
